import React from "react";
import {NavLink} from "react-router-dom";
import web from "../src/images/2.JPG";

const Service=() =>{
    return(
        <>
           <div className="container-fluid">
        <div className="row">
        <div className="col-10 mx-auto">
            <h1 className="text-center my-3">Our Services</h1>
        </div></div>
        <div className="row">
        <div className="col-lg-4 col-md-4 col-6 mx-auto">
        <div class="card" >
  <img src={web} class="card-img-top" alt="img1" />
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <NavLink to="" class="btn btn-primary">Go somewhere</NavLink>
  </div>
 

</div>
        </div>

        
        </div>

           </div>
        </>
    );


};
export default Service;
